import { Route, Switch } from "react-router";
import Home from "./home/Home";

const Host = () => {
  return (
    <div className="host">
      <Switch>
        <Route path="/"> 
          <Home />
        </Route>
      </Switch>
    </div>
  );
};

export default Host;
